Comunistas e Socialistas  ANTIPATRIOTAS CORRUPTOS - Governo  CLEPTOCRATA Governo de LADRÕES - a Partir de Janeiro do ano de 2023 -  Extinção do Partido dos Trabalhadores.
***
ANTIPATRIOTAS têm 13 letras; - o PT de Luiz Inácio Lula da Silva e Dilma Rousseff, Desgovernaram o Brasil, e Saquearam o Erário por 13 anos; - o Número do capítulo da Besta do Apocalipse é 13; Número do PT é 13; o Número de AZAR é 13.; é o que nos Revela o ESPÍRITO SANTO de DEUS Vivo em Nome do SENHOR dos Exércitos JESUS CRISTO.    ;;;;;;
